import React, { useEffect, useState } from 'react';
import './App.css';
import { BookList } from './BookList/BookList';
import { BookAdder } from './BookAdder/BookAdder'
import { IBook } from './Book/Book';


const initialBooks: IBook[] = [
  {
      id: '1',
      name: "Atomic Habits: An Easy & Proven Way to Build Good Habits & Break Bad Ones",
      author: "James Clear",
      cover: "data:image/jpeg;base64,"
  },
  {
      id: '2',
      name: "The Seven Husbands of Evelyn Hugo: A Novel",
      author: "Taylor Jenkins Reid",
      cover: "data:image/jpeg;base64,"
  },
  {
      id: '3',
      name: "Rich Dad Poor Dad: What the Rich Teach Their Kids About Money That the Poor and Middle Class Do Not!",
      author: "Robert T. Kiyosaki",
      cover: "data:image/jpeg;base64,"
  },
  {
      id: '4',
      name: "The Maid: A Novel",
      author: "Nita Prose",
      cover: "data:image/jpeg;base64,"
  },
  {
      id: '5',
      name: "The Boy, the Mole, the Fox and the Horse",
      author: "Charlie Mackesy",
      cover: "data:image/jpeg;base64,"
  },
  {
      id: '6',
      name: "1984",
      author: "George Orwell",
      cover: "data:image/jpeg;base64,"
  }
]

function App() {
  const [books, setBooks] = useState<IBook[]>([]);

  /** При старте  */
  useEffect(() => {
    const rawSavedBooks = localStorage.getItem("books");
    const savedBooks = rawSavedBooks ? JSON.parse(rawSavedBooks) : initialBooks;
    setBooks(savedBooks);
  }, []);

  const updateBookList = (newBooks: IBook[]) => {
    localStorage.setItem('books', JSON.stringify(newBooks));
    setBooks(newBooks);
  }

  const onBookAdd = (newBook: IBook) => {
    const newBooks = [...books, newBook];
    updateBookList(newBooks);
  }

  const onDelete = (bookName: string) => {
    let newBooks = books.filter( book => book.name !== bookName);
    updateBookList(newBooks);
  }

  const onSave = (id: string, name: string, author: string) => {
    let newBooks = books.map(book => {
        if (book.id === id) {
            book.name = name;
            book.author = author;
        }
        return book;
    });
    updateBookList(newBooks);
  }


  return (
    <div className="App">
      <BookAdder onSave={onBookAdd} />
      <BookList books={books} onDelete={onDelete} onSave={onSave} />
    </div>
  );
}

export default App;
